import { Container } from 'react-bootstrap';

function Contact() {
  return (
    <Container className="my-4 text-center" id="contact">
      <h4><strong>Contact</strong></h4>
      <p>For any inquiries, please contact us at example@example.com.</p>
    </Container>
  );
}

export default Contact;
